webpackJsonp([0x9aba08de6243],{1857:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-07-23-bored-at-church/index.md absPath of file >>> MarkdownRemark",html:"<p>Yesterday, my daughter, out of the blue, told her sunday school teacher, \"I'm so bored I could fall asleep.\" We told her that she shouldn't say things like that to her teachers - she is going to kindergarten in the fall so we need to teach her stuff like that.</p>\n<p>The irony is she didn't fall asleep. Instead of saying it, I just fall asleep. I don't remember the last time I made it through sunday school.</p>\n<p>You have to love the hypocrisy of parenthood.</p>",frontmatter:{title:"Bored at Church",date:"July 23, 2007",imageUrl:null,structuredHtml:null,image:null}}},pathContext:{}}}});
